import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useStore } from '../store';
import { useAuth } from '../store/auth';
import { SkillTagList } from '../components/ui/skill-tag';
import { CapacityBar } from '../components/ui/capacity-bar';
import { SeniorityBadge } from '../components/ui/seniority-badge';

function Engineers() {
  const navigate = useNavigate();
  const { engineers, loading, fetchEngineers } = useStore();
  const { isManager } = useAuth();

  React.useEffect(() => {
    fetchEngineers();
  }, [fetchEngineers]);

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-3xl font-bold">Engineers</h1>
        <button className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">
          Add New Engineer
        </button>
      </div>

      {loading ? (
        <p>Loading engineers...</p>
      ) : (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {engineers.map((engineer) => (
            <div key={engineer._id} className="bg-white rounded-lg shadow p-6">
              <div className="flex items-center space-x-4 mb-4">
                <div className="w-12 h-12 bg-blue-100 rounded-full flex items-center justify-center">
                  <span className="text-blue-600 text-xl font-semibold">
                    {engineer.name.charAt(0)}
                  </span>
                </div>
                <div>
                  <h3 className="text-xl font-semibold">{engineer.name}</h3>
                  <p className="text-gray-600">{engineer.email}</p>
                </div>
              </div>
              
              <div className="space-y-3">
                <div>
                  <span className="text-gray-500">Seniority:</span>
                  <span className="ml-2 font-medium capitalize">{engineer.seniority}</span>
                </div>
                <div>
                  <span className="text-gray-500">Capacity:</span>
                  <span className="ml-2">{engineer.maxCapacity}%</span>
                </div>
                <div>
                  <span className="text-gray-500">Skills:</span>
                  <div className="flex flex-wrap gap-2 mt-1">
                    {engineer.skills.map((skill, index) => (
                      <span
                        key={index}
                        className="bg-gray-100 text-gray-700 px-2 py-1 rounded text-sm"
                      >
                        {skill}
                      </span>
                    ))}
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default Engineers;
